import logo from "./logo.svg";
import "./App.css";
import Header from "./Header/Header";
import Footer from "./Footer/Footer";

function App() {
  return (
    <section>
      <div className="App">
        <img src="ilusha.jpg" />
        <Footer />
      </div>
      <div>
        <Header />
      </div>
    </section>
  );
}

export default App;
